import React from 'react';
import { getFavorite, setFavorite, setPantry, setRecipe, setRestrictions, getName, setSuggestions } from './Window';

class Welcome extends React.Component {
    constructor(props) {
      super(props);
    }

    ClickHandler =() =>{
        setFavorite(['Spaghetti', 'pancakes', 'cheese burger']);
        setPantry(['tomato', 'eggs', 'milk']);
        setRecipe("");
        setRestrictions(['nuts', 'soy']);
        setSuggestions(['Spaghetti', "Scrambled Eggs"]);
        window.location.href="/search";
    }

    render() {
      return (
        <form>
        <h1> Welcome {getName()}! </h1>
        <button onClick={this.ClickHandler()}> Proceed </button>
        </form>

      );
    }
  }
  export default Welcome;
